import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import "../css/app.css";

import PrivateRoute from "./PrivateRoute";

import UserStartPage from "./UserStartPage";
import Login from "./login";
import StartingPage from "./StartingPage";
import WorkerStartPage from "./WorkerStartPage";

function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route path="/" exact>
            <StartingPage />
          </Route>
          <Route path="/UserStartPage">
            <UserStartPage />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
          <PrivateRoute path="/WorkerStartPage">
            <WorkerStartPage />
          </PrivateRoute>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
